import React, {Component} from 'react';
import './App.css';
import d3Bar from './components/d3BarChart'
import * as d3 from 'd3'

const data = d3.csv('testdata.csv');
console.log(data)

class App extends React.Component{
  render(){
    return(
      <div className="App">
      <d3Bar 
        height={400}
        width={1250}
        data={data}
      />
      </div>
    )
   }
}

export default App;
